import React from 'react';
import {Link} from 'react-router-dom';

function NavigationBar() {
  return(
    <div className="navigationBar navigationBar-dark bg-primary fixed-left">
      <Link className="navigationBar-brand" to="https://app.mobalytics.gg/summoner-search">Home</Link>
    </div>
  )
}

export default NavigationBar;
